import React from 'react';
import logo from './logo.svg';
import './App.css';
import { NavLink, Redirect } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <ul>
        <li><NavLink to="/" activeClassName="active_class" exact component={() => {
          (Home), name="Home "
        }} > Home </NavLink></li>
        <li><NavLink to="/about" activeClassName="active_class" exact > About </NavLink></li>
        <li><NavLink to="/services" activeClassName="active_class" exact > Services </NavLink></li>
        <li><NavLink to="/contact" activeClassName="active_class" exact > Contact </NavLink></li>
        <Redirect to='/error'></Redirect>
      </ul>
    </div>
  );
}

export default App;
